        private bool BlockedMove()
        {
            if(Math.Abs(X- endMoveX) != Math.Abs(Y - endMoveY))
            {
                return true;
            }

            if(X - endMoveX < 0 && Y - endMoveY < 0)
            {
                for(int i = 1; i < endMoveX - X; i++)
                {
                    if(Board[X + i, Y + i] != null)
                    {
                        return true;
                    }
                }
            }
            else if (X - endMoveX < 0 && Y - endMoveY > 0)
            {
                for (int i = 1; i < endMoveX - X; i++)
                {
                    if (Board[X +  i, Y + -1 * i] != null)
                    {
                        return true;
                    }
                }
            }
            else if (X - endMoveX > 0 && Y - endMoveY < 0)
            {
                for (int i = 1; i < X - endMoveX; i++)
                {
                    if (Board[X + -1 * i, Y + i] != null)
                    {
                        return true;
                    }
                }
            }
            else if (X - endMoveX > 0 && Y - endMoveY > 0)
            {
                for (int i = 1; i < X - endMoveX; i++)
                {
                    if (Board[X + -1 * i, Y + -1 * i] != null)
                    {
                        return true;
                    }
                }
            }
            return false;
        }

